    //     { id: 5, message: 'Good bay' , likequantity: 23},
    //     { id: 6, message: 'Lose' , likequantity: 23}
    //     ]

    return (
        <div className={s.content}>
            <ProfileInfo />
            <MyPosts postsData={props.postsData}/>
        </div>
    );
}

export default Profile;
